import React, { Component } from 'react';
import ListItem from '../../atoms/header/ListItem';
import './listItem.scss';

class List extends Component {

    render() {
        const list = ['Vegetables & Fruits', 'Dairy & Breakfast', 'Muchies', 'Cold Drinks & Juices', 'Instant & Frozen Food',
                      'Tea, Coffee & Health Drinks', 'Bakery & Biscuits'];
        return (
            <div className='list'>
                {
                    list.map((li, index) => <ListItem key={index} name={li} />)
                }
            </div>
        )
    }
}

export default List
